<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <title>cljsh</title>
  <script src="js/out/goog/base.js"></script>
  <script src="js/app.js"></script>
  <link rel="stylesheet" href="css/styles.css">
</head>
<body>
  <div id="navinfo">
    <p><span class="label">pwd</span> ~/dev/cljsh</p>
    <p><span class="label">git</span> branch master (2 uncommited changes)</p>
  </div>
  <div id="log">
    <div class="entry">
      <p class="in"><span class="prompt">$</span> cd dev/cljsh</p>
      <p class="ok out">~/dev/cljsh</p>
    </div>
  </div>
  <div id="input-area">
    <p><span class="prompt">$</span> <input id="input" type="text" autofocus></input></p>
  </div>
  <script>goog.require('app');</script>
</body>
</html>
